import { useState } from "react"

const Example =()=>{
    const [count,setCount]=useState(0);
    const  increment=()=>{
        setCount(count++);
    } 
    return (
        <div>
            <h1>{count}</h1>
            <button onClick={increment}>increment</button>
            </div>
    )
}
export default Example;
